				stage.removeChild(stage.getChildByName("timeCloud"));
		
				Qnum = Math.floor(Math.random() * (game[gameNum].length));
				console.log("my qnum is" + Qnum);
				Inter_counter = 0;
				QarrayLength = ((game[gameNum][Qnum].length) - 1);
		
				var txtOrPic = 1;
				console.log("q array " + game[gameNum][Qnum]);
		
